import React from 'react';

const Banner: React.FC = () => {
  return (
    <div className="banner">
      <h1>AI 婚纱摄影</h1>
      <div className="banner-demo">
        <img src="https://via.placeholder.com/300x100" alt="Demo 1" />
        <img src="https://via.placeholder.com/300x100" alt="Demo 2" />
      </div>
    </div>
  );
};

export default Banner;
